(def back-ch (chan 3e4))
(def trad-rbm (train-cd (create-theoretical-rbm 4 6)
          bars
          :epochs 10000
          :init-learning-rate 0.01
          :learning-rate-fn (fn [i s] i)
          :back-ch back-ch))
