;; @@
(apply plot/compose 
       (map #(plot/list-plot %1 :color %2 :joined true
                             :plot-range [[0 300] [-15 15]] :plot-size 600)
       (mat/transpose trad-weight-traces)
       ["red" "green" "blue" "orange" "brown" "black" "grey"]))
